import './App.css';
import Appbar from './components/Appbar';
import Paper from '@mui/material/Paper';
import React, { useState, useEffect } from 'react';
import TextField from '@mui/material/TextField';
import FormControl from '@mui/material/FormControl';
import { Theme, useTheme } from '@mui/material/styles';
import OutlinedInput from '@mui/material/OutlinedInput';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import Select, { SelectChangeEvent } from '@mui/material/Select';
import Button from '@mui/material/Button';

const Result = () => {

  const [deps, setDeps] = useState([]);
  useEffect(() => {
    fetch('http://localhost:8080/search/deps')
      .then(response => response.json())
      .then(data => {
        const departmentsData = data.map(departmentName => ({
          value: departmentName,
          label: departmentName
        }));

        setDeps(departmentsData);
      })
      .catch(error => {
        console.error('Error fetching departments:', error);
      });
  }, []);

  const [funcs, setFuncs] = useState([]);
  useEffect(() => {
    fetch('http://localhost:8080/search/func')
      .then(response => response.json())
      .then(data => {
        const departmentsData = data.map(departmentName => ({
          value: departmentName,
          label: departmentName
        }));

        setFuncs(departmentsData);
      })
      .catch(error => {
        console.error('Error fetching departments:', error);
      });
  }, []);

  const [apps, setApps] = useState([]);
  useEffect(() => {
    fetch('http://localhost:8080/search/apps')
      .then(response => response.json())
      .then(data => {
        const departmentsData = data.map(departmentName => ({
          value: departmentName,
          label: departmentName
        }));

        setApps(departmentsData);
      })
      .catch(error => {
        console.error('Error fetching departments:', error);
      });
  }, []);

  const [menus, setMenus] = useState([]);
  useEffect(() => {
    fetch('http://localhost:8080/search/menu')
      .then(response => response.json())
      .then(data => {
        const departmentsData = data.map(departmentName => ({
          value: departmentName,
          label: departmentName
        }));

        setMenus(departmentsData);
      })
      .catch(error => {
        console.error('Error fetching departments:', error);
      });
  }, []);




  const [department, setDepartment] = useState('');
  const [func, setFunc] = useState('');
  const [application, setApplication] = useState('');
  const [menu, setMenu] = useState('');
  const [fileName, setFileName] = useState('');
  const [fileType, setFileType] = useState('');
  const [desc, setDesc] = useState('');
  const [auth, setAuth] = useState('');
  // const [file, setFile] = useState(null);

  const ITEM_HEIGHT = 48;
  const ITEM_PADDING_TOP = 8;
  const MenuProps = {
    PaperProps: {
      style: {
        maxHeight: ITEM_HEIGHT * 4.5 + ITEM_PADDING_TOP,
        width: 250,
      },
    },
  };

  const handleSubmit = () => {
    const queryParams = new URLSearchParams();
    queryParams.append('departmentName', department);
    queryParams.append('functionName', func);
    queryParams.append('applicationName', application);
    queryParams.append('menuName', menu);
    queryParams.append('fileName', fileName);
    queryParams.append('fileType', fileType);
    queryParams.append('description', desc);
    queryParams.append('author', auth);
  
    const url = `http://localhost:8080/add?${queryParams.toString()}`;
  
    fetch(url)
      .then(response => {
        // Handle the response
        console.log('Data uploaded successfully:', response.data);
        // Reset the form fields
        setDepartment('');
        setFunc('');
        setApplication('');
        setMenu('');
        setFileName('');
        setFileType('');
        setDesc('');
        setAuth('');
      })
      .catch(error => {
        // Handle the error
        console.error('Error uploading data:', error);
      });
  };
  

  return (
    <div>
      <div style={{ marginBottom: '2cm' }}> <Appbar className="App" /> </div>
      <h1 style={{ textAlign: 'center' }}>Upload Page</h1>
      <form>
        <div style={{ display: 'grid', gridTemplateColumns: '1fr 0.3fr 0.8fr' }}>
          <FormControl sx={{ m: 1, width: 300 }}>
            <InputLabel id="demo-multiple-name-label">Dept</InputLabel>
            <Select
              labelId="demo-multiple-name-label"
              id="demo-multiple-name"
              select
              onChange={e => setDepartment(e.target.value)}
              input={<OutlinedInput label="Name" />}
              MenuProps={MenuProps}
            >
              {deps.map((name) => (
                <MenuItem
                  key={name.value}
                  value={name.value}
                >
                  {name.label}
                </MenuItem>
              ))}
            </Select>
          </FormControl>
          <h4>Or Department : </h4>
          <input type="text" value={department} onChange={e => setDepartment(e.target.value)} />
        </div>
        <div style={{ display: 'grid', gridTemplateColumns: '1fr 0.3fr 0.8fr' }}>
          <FormControl sx={{ m: 1, width: 300 }}>
            <InputLabel id="func-id">Func</InputLabel>
            <Select
              labelId="func-id"
              id="func-id"
              select
              onChange={e => setFunc(e.target.value)}
              input={<OutlinedInput label="Name" />}
              MenuProps={MenuProps}
            >
              {funcs.map((name) => (
                <MenuItem
                  key={name.value}
                  value={name.value}
                >
                  {name.label}
                </MenuItem>
              ))}
            </Select>
          </FormControl>
          <h4>Or Function : </h4>
          <input type="text" value={func} onChange={e => setFunc(e.target.value)} />
        </div>
        <div style={{ display: 'grid', gridTemplateColumns: '1fr 0.3fr 0.8fr' }}>
          <FormControl sx={{ m: 1, width: 300 }}>
            <InputLabel id="demo-multiple-name-label">App</InputLabel>
            <Select
              labelId="demo-multiple-name-label"
              id="demo-multiple-name"
              select
              onChange={e => setApplication(e.target.value)}
              input={<OutlinedInput label="Name" />}
              MenuProps={MenuProps}
            >
              {apps.map((name) => (
                <MenuItem
                  key={name.value}
                  value={name.value}
                >
                  {name.label}
                </MenuItem>
              ))}
            </Select>
          </FormControl>
          <h4>Or Application : </h4>
          <input type="text" value={application} onChange={e => setApplication(e.target.value)} />
        </div>
        <div style={{ display: 'grid', gridTemplateColumns: '1fr 0.3fr 0.8fr' }}>
          <FormControl sx={{ m: 1, width: 300 }}>
            <InputLabel id="demo-multiple-name-label">Menu</InputLabel>
            <Select
              labelId="demo-multiple-name-label"
              id="demo-multiple-name"
              select
              onChange={e => setMenu(e.target.value)}
              input={<OutlinedInput label="Name" />}
              MenuProps={MenuProps}
            >
              {menus.map((name) => (
                <MenuItem
                  key={name.value}
                  value={name.value}
                >
                  {name.label}
                </MenuItem>
              ))}
            </Select>
          </FormControl>
          <h4>Or Menu : </h4>
          <input type="text" value={menu} onChange={e => setMenus(e.target.value)} />
        </div>
        <div style={{ display: 'grid', gridTemplateColumns: '1fr 1fr 1fr 1fr' }}>
          <div>
            <h4>File Name : </h4>
            <input type="text" value={fileName} onChange={e => setFileName(e.target.value)} />
          </div>
          <div>
            <h4>File Type : </h4>
            <input type="text" value={fileType} onChange={e => setFileType(e.target.value)} />
          </div>
          <div>
            <h4>Author : </h4>
            <input type="text" value={auth} onChange={e => setAuth(e.target.value)} />
          </div>
          <div>
          <h4>Description : </h4>
          <input type="text" value={desc} onChange={e => setDesc(e.target.value)} />
        </div>
        </div>
        <Button variant="contained" onClick={handleSubmit} type="submit" style={{marginTop : '2em', marginLeft : '30vw'}}>Submit</Button>
      </form>
    </div>
  );
};

export default Result;
